import React from 'react';
import './Acomodações.css';

const accommodations = [
  {
    title: 'Quarto Standard',
    description: 'Um quarto aconchegante com cama queen-size, lençóis brancos, mesa simples, cadeira e TV de tela plana.',
    imageUrl: 'path/to/your/image/file-pySoxxXd8PKoZfkCc6748leW.png', // Atualize este caminho para o local correto da imagem
  },
  // Outras acomodações podem ser adicionadas aqui
];

const Acomodações = () => {
  return (
    <div className="accommodations-container">
      {accommodations.map((accommodation, index) => (
        <div key={index} className="accommodation">
          <img src={accommodation.imageUrl} alt={accommodation.title} />
          <h3>{accommodation.title}</h3>
          <p>{accommodation.description}</p>
        </div>
      ))}
    </div>
  );
};

export default Acomodações;
